import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function Main() {
  const navigate = useNavigate();

  useEffect(() => {
    if (localStorage.getItem("token")) {
      navigate("/home");
    } else {
      navigate("/");
    }
  }, [navigate]);

  const handleonclickdir = () => {
    navigate('/signup');
  };

  return (
    <div className="bg-gradient-to-b from-[#E2EAF4] to-white min-h-screen flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-black text-7xl font-bold mb-4">
          Welcome to
        </h1>
        <h2 className="text-black text-4xl font-semibold mb-6">
          Voting App
        </h2>
        <div
          className="cursor-pointer inline-block"
          role="button"
          onClick={handleonclickdir}
        >
          <div className="text-black text-sm no-underline p-3 border-2 border-transparent rounded-md bg-gray-400 hover:bg-gray-500 transition duration-300">
            GET Started <i className="fa-solid fa-arrow-right"></i>
          </div>
        </div>
      </div>
      <div className="hidden md:block w-1/2">
        <img src="/path-to-your-image.jpg" alt="Voting" className="object-cover w-full h-full" />
      </div>
    </div>
  );
}
